import { NgModule } from '@angular/core';
import { TooltipModule } from 'primeng/tooltip';
import { ButtonModule } from 'primeng/button';
import { InputTextModule } from 'primeng/inputtext';

@NgModule({
  imports: [
    TooltipModule,
    ButtonModule
  ],
  exports: [
    TooltipModule,
    ButtonModule,
    InputTextModule,
  ],
  providers: [],
})
export class PrimengLibsModule { }
